La phylogenèse ou phylogénie, du grec ancien φῦλον / phûlon, « tribu, famille, clan » et γένεσις / génesis, « création », est l'étude des liens de parenté (relations phylogénétiques ou phylétiques) entre les êtres vivants et ceux qui ont disparu : 
* entre individus (niveau généalogique ; seule une généalogie individuelle peut répondre à la question « qui est l'ancêtre de qui ? », tandis qu'une phylogénie de groupe peut répondre à la question « qui est le plus proche parent de qui ? ») ; 
* entre populations (à l'intérieur d'une même espèce qui, pour simplifier, peut se résumer à une population dont les membres sont interféconds : niveau intraspécifique) ; 
* entre espèces (niveau interspécifique). La phylogenèse permet de reconstituer l'évolution des organismes vivants. En phylogenèse, on représente couramment les parentés par un arbre phylogénétique. Le nombre de nœuds entre les branches, qui représente autant d'ancêtres communs, indique le degré de parenté entre les individus, les groupes ou les taxons. Plus il y a de nœuds et donc d'ancêtres intermédiaires entre deux êtres vivants, plus leur ancêtre commun est ancien et plus leur parenté actuelle est éloignée. En phylogenèse interspécifique, un arbre (dendrogramme) est élaboré : 
* soit par (phénogramme), la longueur des branches représentant la distance génétique entre taxons ; 
* soit par cladistique (cladogramme), où l'on place sur les branches les événements évolutifs (états dérivés de caractères homologues) ayant eu lieu dans chaque lignée.
